<script>
function cache_loupe()
{
 document.getElementById('loupe').innerHTML="";
}
function affiche_loupe()
{
 document.getElementById('loupe').innerHTML='<img src="http://geoloc9.geovisite.com:8080/skin/png/loupe30.png">';
}

var decaly=0;decalx=0;
onload=function(){
//deplaceBG();
var timer=setInterval("deplaceBG()", 75);
}
var pause=0;
var pause2=0;var only=0;
var pause3=0;
var txt_total=document.getElementById('total').innerHTML;
function deplaceBG(){
if(pause>=0 && pause<10){document.getElementById('total').innerHTML=txt_total;}
else if(pause>=10 && pause<20){document.getElementById('total').innerHTML="Online 8";}
else{document.getElementById('total').innerHTML="Last 24h - Dernieres 24h";}
if(pause>30){pause=0;}
pause++;

if(pause3>10){decaly=-150;}
else{decaly=0;}
if(pause3>20){pause3=0;}
pause3++;

document.getElementById('onldiv').style.top=only+"px";
if(pause2%20==0){only-=15;}
if(only<-5*15){only=0;}
pause2++;

document.getElementById('geomap').style.backgroundPosition=decalx+"px "+decaly+"px"; 

}
</script>
